import './App.css';
import logo from 'logo.jpg';
function App() {
  return (
    <div className="bio-marketing-container">
      <div className="logo">
        <img src="{logo}" alt="Bio Logo" width="259" height="182" />
      </div>
      <h1 className="main-text">Грижим се за тяхното здраве</h1>
      <div className="features">
        <div className="feature">
          <img src="https://dashboard.codeparrot.ai/api/assets/Z0trwrLVBCaRbmUG" alt="Feature 1" width="92" height="92" />
        </div>
        <div className="feature highlighted">
          <img src="https://dashboard.codeparrot.ai/api/assets/Z0trwrLVBCaRbmUH" alt="Feature 2" width="92" height="92" />
          <p>Натурални съставки</p>
        </div>
        <div className="feature">
          <img src="https://dashboard.codeparrot.ai/api/assets/Z0trw7LVBCaRbmUI" alt="Feature 3" width="92" height="92" />
        </div>
        <div className="feature">
          <img src="https://dashboard.codeparrot.ai/api/assets/Z0trw7LVBCaRbmUJ" alt="Feature 4" width="92" height="92" />
        </div>
      </div>
    </div>
  );
};

export default App;
